Sounds good, but doesn't work. `get_sysvar` [is defined](https://github.com/rustopian/solana-sdk/blob/0a7699de0f6eeefb8cf8f6b19c65ad7b7d435430/sysvar/src/lib.rs#L207) to take a mutable slice. I'm not sure it's worth changing that, as it just basically moves some things around and is unlikely to save cycles.

E.g. `PodSlotHashes` calls it a similar way, close to the method here but without `MaybeUninit`:
```
let mut data = vec![0; sysvar_len];

// Ensure the created buffer is aligned to 8.
if data.as_ptr().align_offset(8) != 0 {
    return Err(solana_program_error::ProgramError::InvalidAccountData);
}

// Populate the buffer by fetching all sysvar data using the
// `sol_get_sysvar` syscall.
crate::get_sysvar(
    &mut data,
    &SlotHashes::id(),
    /* offset */ 0,
    /* length */ sysvar_len as u64,
)?;
```
